import apiURL from '../config/apiURL' 
function Admin() {
  return (
    <div className="mainContainer">
      <div className="header">
        <img src={dataIcon} className="dataIcon" />
        <p className="title">Data to train AI Model</p>
      </div>
      <textarea className="customTextarea"></textarea>
